import axios from "axios";
import {useState, useEffect} from "react";
import {Link} from "react-router-dom";
import './css/style.css'
//import {axiosInstance} from "../network/index";

function Favorite() {
  const [movies, setMovies] = useState([])

  useEffect(() => {
    axios
    .get("https://api.themoviedb.org/3/movie/popular?api_key=1329a0f37fb81007926e9991415232ac")
    .then((res)=> {
      setMovies(res.data.results)

    })
    .catch((err) => {
      console.log(err)
    })
  },[])


    return (
      <>
     {/* <h1> Movies </h1> */}
     <div className="container">
     <div className="row "> 



  				{movies.map((movies) => {
  					return (  
              <div className="col-md-3" key={movies.id} >
                <div className="card" id="n">
                  <img className="card-img-top" src={`https://image.tmdb.org/t/p/w500/${movies.poster_path}`}/>
                    <div className="card-body" >
                      <div className="card-title" id="k"> {movies.original_title}</div>
                      <div className="card-text">
  							<Link to={`/Showmovie/${movies.id}`}> 
							Show Movie Details
  							</Link>
                </div>
                </div>

                </div>
                </div>
  						)

  				})}

  			</div>
        </div>
        </>
    );
  }

  export default Favorite;
